import { useState } from 'react';

function App() {
	const [number, setNumber] = useState(0);

	const handleCounter = (event) => {
		let count = number + 1;

		setNumber(count);
	};

	return (
		<div>
			<h1>Contador: {count}</h1>
			<button onclick={handleCounter}>Contador +</button>
		</div>
	);
}

export default App;
